//Let's get document.all back
if(!document.all) {
    document.all = function() {
        if ( (typeof(arguments[0])).toLowerCase()  == "string") {
            return document.getElementById(arguments[0]);
        }
        else if ( (typeof(arguments[0])).toLowerCase() == "number") {
            return document.getElementsByTagName("*")[arguments[0]];    
        }
    };
}

/*blink!*/
/* Blink already works in FF and Opera */
/* Lets do some awesome Web 1.0 style user agent detection to enable the other browsers*/

var ua = navigator.userAgent;
if(!ua.match(/Firefox[\/\s]\d+\.\d+/) && !ua.match(/Opera[\/\s]\d+\.\d+/)){
    var blinks = document.getElementsByTagName( "blink" ),
        test = blinks.length;
    
    if ( test > 0 ){
        (function(blinkTags){
            var callback = function() { 
                for (var i = 0; i <test; i++) {
                    var blink = blinkTags[i];
                    if(blink){
                        var style = blink.style;
                        if ( style.visibility === "visible" ){
                            style.visibility = "hidden";    
                        } else {
                            style.visibility = "visible";
                        }
                    }
                }
            };
            setInterval( callback, 500 );
        }(blinks));
    }
}

/* dancing baby canvas */
var baby = (function(){
    var _babyFrames = ["data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,"],
        _frames = [],
        _draw = function(canvas, ctx, i) {
            var img,
                load = function(){
                _frames[i] = img;
                canvas.width = canvas.width;
                ctx.drawImage(img, 0, 0);
            
                i++;
                if(i >= _babyFrames.length){
                    i = 0;
                }

                setTimeout(function(){
                    _draw(canvas, ctx, i);
                }, 100);
            };

            if(!_frames[i]){
                img = document.createElement('img');
                img.src = _babyFrames[i];
                img.onload = load;
            }
            else {
                img = _frames[i];
                load();
            }
        };

    return function(className){
        var containers = document.getElementsByClassName(className);

        for(var i = 0, length = containers.length; i < length; i++){
            var canvas = document.createElement('canvas');
            canvas.width = 220;
            canvas.height = 200;

            containers[i].appendChild(canvas);
            var ctx = canvas.getContext("2d");
            _draw(canvas, ctx, 0);
        }
    };
}());
baby('baby');